import {BrowserRouter, Switch, Route} from "react-router-dom";
// import Home from "./components/home/Home";
// import Form from "./components/home/Formularz";
// import AboutUs from "./components/home/AboutUs";
// import Excursions from "./components/excursions/Excursions";
// import Lwow from "./components/excursions/Lwow";
// import Castle from "./components/excursions/Castle";
// import Ship from "./components/excursions/Ship";
// import Carpatians from "./components/excursions/Carpatians";
// import Contact from "./components/home/Contact";
// import FormSubmission from "./components/home/FormSubmission";

function App() {
    return (
        <>
            <BrowserRouter>
                <Switch>
                    <Route exact path="/" component={Home} />
                    <Route exact path="/About-us" component={AboutUs} />
                    <Route exact path="/FormSubmission" component={FormSubmission} />
                    <Route exact path="/Excursions/Lwow" component={Lwow} />
                    <Route exact path="/Excursions/Castle" component={Castle} />
                    <Route exact path="/Excursions/Ship" component={Ship} />
                    <Route exact path="/Excursions/Carpatians" component={Carpatians} />
                    <Route exact  path="/Contact" component={Contact} />
                    <Route exact path="/Excursions" component={Excursions} />


                </Switch>
            </BrowserRouter>
        </>
    );
}

export default App;
